import React, { Component } from 'react';

const ServiceBtn = ({ position, top, left, bgcolor, width, height }) => (
  <button
    style={{
      position: position,
      top: top,
      left: left,
      backgroundColor: bgcolor,
      width: width,
      height: height
    }}
  >
    Services
  </button>
);

const PrixBtn = ({ position, top, left, bgcolor, width, height }) => (
  <button
    style={{
      position: position,
      top: top,
      left: left,
      backgroundColor: bgcolor,
      width: width,
      height: height
    }}
  >
    Prix
  </button>
);

const PromotionBtn = ({ position, top, left, bgcolor, width, height }) => (
  <button
    style={{
      position: position,
      top: top,
      left: left,
      backgroundColor: bgcolor,
      width: width,
      height: height
    }}
  >
    Promotions
  </button>
);

const ImageTarifs = ({ position, width, height, top, left }) => (
  <img
    style={{
      position: position,
      width: width,
      height: height,
      top: top,
      left: left
    }}
    src={require('../../img/tarifs.png')}
    alt='Homeimg'
  />
);

export class Services extends Component {
  render() {
    return (
      <div>
        <div>
          <ServiceBtn />
          <PrixBtn />
          <PromotionBtn />
        </div>
        <div>
          <ImageTarifs />
          <div>
            <h1></h1>
            <p></p>
          </div>
        </div>
      </div>
    );
  }
}

export default Services;
